import React, { useEffect, useState} from 'react';
import logo from './logo.svg';
import './App.css';
import { JoblyApi } from './Api';
import { NavBar } from './NavBar';
import { Login } from './Login';
import { Signup } from './Signup';
import { RouteComponent as Routes } from './RouteComponent';

function App() {
  const [token, setToken] = useState();



    async function login(username, password) {
      const getToken = await JoblyApi.login(username, password);
      setToken(getToken);
  };

  async function register(username, password, name, firstname, lastname, email) {
    const signup = await JoblyApi.login(username, password, name, firstname, lastname, email);
      setToken(signup);
  };

  function logout() { 
    setToken(logout)
  }




  return (
    <div className="App">
      <header className="App-header">

        <Routes login={login} Sign={register} />



      </header>
    </div>
  );
}

export default App;
